import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import {useFetch} from "../../hooks/useFetch";
import "../Tela.css"
import { useState , useEffect } from "react";

const Form2 = (props) => {   
 
    
    return <>
                    <h2>Escolha seus interesses</h2>
                    <Form.Group className="mb-2">
                    <Form.Label htmlFor="genero">Quais s√£o os seus interesses?</Form.Label>
                    <div class="form-check">

                      

                        {props.temas && props.temas.map((tema) => (<>
                                <input  key={tema.id_tema} class="form-check-input" type="checkbox" value="" id="flexCheckDefault"/>
                                <label  class="form-check-label" for="flexCheckDefault">
                                    {tema.tema}
                                </label>
                                </>
                        ))}
 
                    
                    </div>
                    </Form.Group>

                    <br/>
                    <Button variant="primary" type="submit" className="px-5 mb-3 mt-3">
                    Enviar
                    </Button>   
    </>
}

export default Form2;
